import axios from "axios"

export const createUser= async (e) => {
    e.preventDefault();
        
    let data = {
        mail: e.target.mail.value,
        password: e.target.password.value
    }
     
     await axios.post("http://localhost:1234/loggin/create", data);
     this.setState({page: "login", 
                     mail: e.target.mail.value, 
                     password: e.target.password.value});
}
